SELECT DISTINCT stg.customer_id AS customer_id, stg.product_id AS product_id, tr.test_roster_id, se.ou_id AS ou_id, se.sh_id AS sh_id, tr.org_node_id AS gh_id, tr.student_id AS student_id, tc.item_set_id AS tc_item_set_id, p.product_name AS test_name, tr.form_assignment, tc.eiss_test_level AS test_level, s.barcode AS barcode, tc.commodity_code AS commodity_code, tr.udf AS udf, tr.test_completion_status AS test_completion_status, se.grade gh_grade, s.grade pre_grade, tr.litho_code litho_code
FROM TEST_CATALOG tc, STUDENT s, TEST_ADMIN ta, TEST_ROSTER tr, PRODUCT p, stg_param_winscr_tb stg, STUDENT_ITEM_SET_STATUS si, ITEM_SET it, ORG_NODE_STUDENT ons, stg_eiss_tb se, stg_test_roster str
WHERE tr.test_admin_id = ta.test_admin_id AND ta.test_catalog_id = tc.test_catalog_id AND tr.customer_id = stg.customer_id AND ta.product_id = stg.product_id AND p.product_id = stg.product_id AND tc.product_id = stg.product_id AND s.student_id = tr.student_id AND si.test_roster_id = tr.test_roster_id AND it.item_set_id = si.item_set_id AND it.SAMPLE = 'F' AND tr.student_id = ons.student_id AND tr.org_node_id = ons.org_node_id AND se.sr_id = s.student_id AND se.level_type = 'SR' AND se.gh_id = tr.org_node_id AND tr.test_roster_id = str.test_roster_id
