SELECT tr.test_roster_id,tr.customer_id, tr.student_id FROM student st, test_roster tr, test_admin ta, test_catalog tc, stg_param_winscr_tb stg, org_node_student ons WHERE st.student_id = tr.student_id AND tr.test_admin_id = ta.test_admin_id AND ta.test_catalog_id = tc.test_catalog_id AND tr.customer_id = stg.customer_id AND tr.customer_id = ta.customer_id AND ta.product_id = tc.product_id AND ta.product_id = stg.product_id AND tr.activation_status = 'AC' AND tr.student_id = ons.student_id AND tr.org_node_id = ons.org_node_id AND tr.test_completion_status NOT IN ('NT', 'SC') AND ( EXISTS ( SELECT NULL FROM item_response ir,item_set ist WHERE ir.test_roster_id = tr.test_roster_id AND ir.item_set_id=ist.item_set_id AND ist.sample<>'T' AND ir.response_seq_num = (SELECT MAX (response_seq_num) FROM item_response irmax WHERE irmax.test_roster_id = ir.test_roster_id AND irmax.item_id = ir.item_id) AND ir.response IS NOT NULL) OR EXISTS ( SELECT NULL FROM item_response_cr irc,item_set ist WHERE irc.test_roster_id = tr.test_roster_id AND irc.item_set_id=ist.item_set_id AND ist.sample<>'T' AND REPLACE(to_char(constructed_response),'%20',NULL) IS NOT NULL))
